import { Menu } from "./Navigation";
import {BrowserRouter, Route, Routes} from 'react-router-dom'
import { Home } from "./SampleComps";

const App=()=>{
  return (
    <>
      <BrowserRouter>
        <Menu/>
        <Routes>
          <Route path="/" exact element="<Home/>"/>
        </Routes>
      </BrowserRouter>
      <h1>Hai!!!!!!!!!!!!!</h1>
    </>
  );
}

export default App;
